import { ClientCardData } from '../cardListFolder/clientCardData'


export const CompletedCardsComponent = ({   routesCompleted,
                                            setCurrentClientData,
                                            setShowMore}) => {
  

    return (
        <>

          <section className = 'cardsListContainer'>

            { routesCompleted.map( (e)=>
            
              <div key = { e.directionClient } className='clientCard'>

                <ClientCardData clientData = { e }
                                setCurrentClientData = { setCurrentClientData}
                                setShowMore = { setShowMore }/>

              </div>
            
            ) }

          </section>
          
        </>
    )    
}
